import Link from 'next/link';

const About = () => (

    <div>
        <h1>About page </h1>

        <ul>
        <li><Link href='/'><a>Home</a></Link></li>
        <li><Link href='/about'><a>About</a></Link></li>

    </ul>

        <p>Application to view and track projects</p>

    </div>


    );

    export default About;
